import React from 'react';

export default class ContactModal extends React.Component {
	constructor(props) {
		super(props);
	}
		modalhandle(event){
		$(document).ready(function(){
		  $(".customSpan").click(function(){

		  });



		});


	}

	render() {
		return (
			<div>
				<button type="button" class="btn btn-info btn-lg" data-toggle="modal" onClick={this.modalhandle.bind(this)} data-target="#contactUs">Open Modal</button>
				<div id="contactUs" class="modal fade" role="dialog">
				  <div class="modal-dialog">
				    <div class="modal-content">
				      <div class="modal-header">
				        <button type="button" class="close" data-dismiss="modal">&times;</button>
				        <h4 class="modal-title">Modal Header</h4>
				      </div>
				      <div class="modal-body">
				        <p>Some text in the modal.</p>
				      </div>
				      <div class="modal-footer">
				        <button type="button" class="btn btn-default" data-dismiss="modal">Close</button>
				      </div>
				    </div>

				  </div>
				</div>
			</div>
		);
	}
}
